import { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Spinner from 'react-bootstrap/Spinner';
import { ethers } from 'ethers';

import Alert from './Alert';
import { removeLiquidity, loadBalances } from '../store/interactions';

const Withdraw = () => {
  const [amount, setAmount] = useState(0);
  const [showAlert, setShowAlert] = useState(false);

  const provider = useSelector(state => state.provider.connection);
  const account = useSelector(state => state.provider.account);
  const shares = useSelector(state => state.amm.shares);

  const tokens = useSelector(state => state.tokens.contracts);
  const balances = useSelector(state => state.tokens.balances);

  const selectedAmm = useSelector(state => state.amm.selectedAmm);
  const ammContracts = useSelector(state => state.amm.contracts);
  const amm = ammContracts[selectedAmm];

  const isWithdrawing = useSelector(state => state.amm.withdrawing.isWithdrawing);
  const isSuccess = useSelector(state => state.amm.withdrawing.isSuccess);
  const transactionHash = useSelector(state => state.amm.withdrawing.transactionHash);

  const dispatch = useDispatch();

  const withdrawHandler = async (e) => {
    e.preventDefault();

    setShowAlert(false);

    const _shares = ethers.utils.parseUnits(amount.toString(), 'ether');
    await removeLiquidity(provider, amm, _shares, dispatch);
    await loadBalances(amm, tokens, account, dispatch);

    setShowAlert(true);
    setAmount(0);
  };

  return (
    <div>
      <Card style={{ maxWidth: '450px' }} className='mx-auto px-4 card-style'>
        {account ? (
          <Form onSubmit={withdrawHandler} style={{ maxWidth: '450px', margin: '50px auto' }}>

            <Row>
              <Form.Text className='text-end my-2 ' style={{color:"white"}}>
                Shares: {shares}
              </Form.Text>
              <InputGroup>
                <Form.Control
                  type="number"
                  placeholder="0"
                  min="0.0"
                  step="any"
                  id="shares"
                  value={amount === 0 ? "" : amount}
                  onChange={(e) => setAmount(e.target.value)}
                  className='input-group-custom'

                />
                <InputGroup.Text style={{ width: "100px" }} className="justify-content-center deposit-labels">
                  Shares
                </InputGroup.Text>
              </InputGroup>
            </Row>

            <Row className='my-3'>
              {isWithdrawing ? (
                <Spinner animation="border" style={{ display: 'block', margin: '0 auto' }} />
              ) : (
                <Button type="submit" className='btn-custom'>Withdraw</Button>
              )}
            </Row>

            <hr />

            <Row>
              <p><strong>DAPP Balance:</strong> {balances[0]}</p>
              <p><strong>USD Balance:</strong> {balances[1]}</p>
            </Row>

          </Form>

        ) : (
          <p
            className='d-flex justify-content-center align-items-center'
            style={{ height: '300px' }}
          >
            Please connect wallet.
          </p>
        )}
      </Card>

      {isWithdrawing ? (
        <Alert
          message={'Withdraw Pending...'}
          transactionHash={null}
          variant={'info'}
          setShowAlert={setShowAlert}
        />
      ) : isSuccess && showAlert ? (
        <Alert
          message={'Withdraw Successful'}
          transactionHash={transactionHash}
          variant={'success'}
          setShowAlert={setShowAlert}
        />

      ) : !isSuccess && showAlert ? (
        <Alert
          message={'Withdraw Failed'}
          transactionHash={null}
          variant={'danger'}
          setShowAlert={setShowAlert}
        />
      ) : (
        <></>
      )}

    </div>
  );
}

export default Withdraw;
